import axios from 'axios'
export const FETCH_POSTS = "POSTS/FETCH_POSTS"



export function fetchData () {
    const url = 'http://localhost:5000/api/auth/books'
    return(
        {
            type: FETCH_POSTS,
            payload: url
        }
    )
};

export function changeBooks() {
    return(
        {
            type: FETCH_POSTS,
            payload: url
        }
    )
}
